import React from 'react';
import logo from './cat.gif';
import './App.css';

function App() {
  return (
    <div className="thisApp">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Good Morning!
        </p>
      </header>
    </div>
  );
}

export default App;
